import React from 'react';

const AdminDashboard = () => {
  return (
    <div>
      <h1>Administratörsöversikt</h1>
      <div>
        <p>Antal registrerade användare: [antal]</p>
        <p>Pågående arbetsordrar: [antal]</p>
        <p>Nya meddelanden: [antal]</p>
        <p>Dagens datum och tid: [datum och tid]</p>
      </div>
    </div>
  );
};

export default AdminDashboard;
